// UserLogin.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import AuthService from '../../services/AuthService';
import { useAuth } from '../../context/AuthContext';

function UserLogin() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();
  const { login } = useAuth();

  const loginUser = async (event) => {
    event.preventDefault();

    try {
      const response = await AuthService.authenticateUser({ email, password });

      if (response.data.message === 'Email not exists') {
        setError('Email not exists');
      } else if (response.data.message === 'Login Success') {
        login(response.data.userId); // Set the user ID in the global state
        navigate('/user-home');
      } else {
        setError('Incorrect Email and Password not match');
      }
    } catch (err) {
      setError('An error occurred during login');
      console.error('Login error:', err);
    }
  };

    return (
       <div>
            <div className="container">
            <div className="row">
                <h2>Login</h2>
             <hr/>
             </div>

             <div className="row">
             <div className="col-sm-6">

            <form>
        <div className="form-group">
          <label>Email</label>
          <input type="email"  className="form-control" id="email" placeholder="Enter Name"

          value={email}
          onChange={(event) => {
            setEmail(event.target.value);
          }}

          />

        </div>

        <div className="form-group">
            <label>password</label>
            <input type="password"  className="form-control" id="password" placeholder="Enter Fee"

            value={password}
            onChange={(event) => {
              setPassword(event.target.value);
            }}

            />
          </div>
                  <button type="submit" className="btn btn-primary" onClick={loginUser} >Login</button>
              </form>

            </div>
            </div>
            </div>

     </div>
    );
  }

  export default UserLogin;
